import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { useState, useEffect } from "react";
import Home from "./components/Home";
import FormElement from "./components/Form";


function App() {
  useEffect(() => {
    const reloadPage = (event) => {
      event.preventDefault();
      event.returnValue = "";
      window.location.href = "/";
    };

    window.addEventListener("beforeunload", reloadPage);

    return () => {
      window.removeEventListener("beforeunload", reloadPage);
    };
  }, []);

  const [datas, setDatas] = useState("");

  const onDataRegister =(register) => {
    setDatas([...datas, register]);
  }
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/form" element={<FormElement onRegister={register => onDataRegister(register)}/>}/>
      </Routes>
    </Router>
  );
}

export default App;
